<template>
  <div>
    <div v-if="network">
      <div style="width:143px ;margin: 0px auto 52px auto; padding-top: 182px;">
        <img :src="netWorkImage" alt="" style="width:100%">
        <div style="color: #999999;font-size: 15px;text-align: center;margin-top: 21px">
          暂无网络连接
        </div>
      </div>
      <div style="text-align: center;">
        <van-button
          @click="reLoad"
          style="width: 217px;background: #337EFF;height: 48px;border-radius: 43px;color: #fff;text-align: center;line-height: 48px;margin: 48px auto">
          重新加载
        </van-button>
      </div>
    </div>
    <div v-else style="position: absolute;top: 40%;left: 40%;">
      <van-loading size="24px" vertical>加载中...</van-loading>
    </div>
  </div>
</template>
<script>
import Vue from 'vue'
import { Button, Toast, Loading } from 'vant'

Vue.use(Button)
Vue.use(Loading)
Vue.use(Toast)
export default {
  data () {
    return {
      network: false,
      form: this.$route.query.form,
      urlPath: this.$route.query.urlPath,
      urlQuery: this.$route.query.urlQuery,
      loading: false,
      netWorkImage: 'data:image/png;base64,'
    }
  },
  mounted () {
    const caringCurrentDevice = localStorage.getItem('caringCurrentDevice')
    if (caringCurrentDevice === 'weixin') {
      this.network = false
    } else {
      this.network = this.$route.query.network === '1'
    }
  },
  methods: {
    reLoad () {
      debugger;
      const NET_WORK_STATUS = localStorage.getItem('NET_WORK_STATUS')
      let query = {}
      if (this.urlQuery) {
        query = JSON.parse(this.urlQuery)
      }
      if (NET_WORK_STATUS !== 'none') {
        if (this.urlPath && this.urlPath !== 'undefined') {
          this.$router.replace({
            path: this.urlPath,
            query: query
          })
        } else if (this.form === 'api') {
          this.$router.go(-1)
        } else {
          this.$h5Close()
        }
      } else {
        // 通知uni发送新的网络状态给h5
        Toast({message: '请检查网络', closeOnClick: true})
      }
    }
  }
}
</script>
